window.bookSummaryJSON = "<p>From #1 <i>New York Times</i> and <i>USA Today</i> bestselling author Jennifer L. Armentrout comes the next installment in her Wicked series.</p> <p>The King must have his Queen....</p> <p>Bestowed the forbidden Summer’s Kiss by the King of the Summer fae, Brighton Jussier is no longer just human. What she is, what she will become, no one knows for sure, but that isn’t her biggest concern at the moment. Now Caden, the King, refuses to let her go, even at the cost of his Court. When the doorway to the Otherworld is breached, both Brighton and Caden must do the unthinkable - not just to survive themselves, but also to save mankind from the evil that threatens the world.</p> <p>**Every 1001 Dark Nights novella is a standalone story. For new readers, it’s an introduction to an author’s world. And for fans, it’s a bonus book in the author’s series. We hope you'll enjoy each one as much as we do.**</p>"; 
